				<p>Get Set Home is a service, a platform and an access to good quality shared accommodations and guesthouses. Founded in March 2014, Get Set Home aims to revolutionize the way individuals and businesses utilize home apartment rentals for their long and short term needs.</p>

				<p>We realize that students, bachelors or working professionals that have moved into a new city or are simply seeking their own space today go through a lot of hassles to find good quality homes. Often rejected tenancy because in todays society being a Bachelor is considered the biggest taboo and societies are self proclaimed guardians of culture. This is just the trailer, the entire movie is lot more painful exercise where one has to deal with unprofessional brokers, high upfront payments, hours of travelling, sub standard PG accommodations, the room mate hunt only if the house hunt wasn’t enough. Unlike in the movies these don’t really have Happy Endings.</p>

				<p>So don’t let the excitement of a new job or a promotion in an MNC, the dream of becoming the next super model or the thrill of holding an admission ticket to your dream MBA institute turn sour on facing the harsh truth of being rejected a good quality home.</p>

				<p>As our name suggests we at Get Set Home provide completely furnished homes - a set home. We set up these homes with all house essentials along with some love and warmth so that you can call the house your home. You can simply walk in with you suitcase into these set homes as you would into your own where all your daily house necessities are taken care off.</p>
